Unocalは「Union Oil Company of California」の略なんですね。<br>76ブランドのガス・ステーションとしてお馴染みで、日本でも人気の高いロゴです！<p>このロゴは、1890年設立のユニオンオイルカンパニー・オブ・カリフォルニア（ユノカル）が、<br>1932年に考案したもので、現在ではオイルメーカーのLubricants Companyに引き継がれ、<br>1997年にスタートしました。<br>ちなみに76は、アメリカの独立の1776年と、ガソリンのオクタン価が76であたことに由来しているそうです。<p>デザインがとてもポップで、インパクトがあります！<br>オススメです！<p>まるいデザインのブリキ看板です。<br>車やガソリンメーカー、車関係のプレートが多く見られます。</p><p>サイズ：直径29.8cm<br>素材：ブリキ</p><p>※こちらの看板は輸入時に商品が裸の状態で入荷してまいります。その為、看板ふちの部分に擦り傷等がある場合がございます。予めご了承下さい。尚、当店にて確認後、状態の悪い物に付きましては出荷いたしておりません。</p><style type="text/css">
